import React from "react";

const Country = ({ img, name, pop, reg, cap }) => {
  return (
    <div className="country-card">
      <div className="country-img">
        <img src={img} alt="" />
      </div>
      <div className="country-data">
        <h3>name:{name}</h3>
        <ul>
          <li>Population:{pop}</li>
          <li>Region:{reg}</li>
          <li>Capital:{cap}</li>
        </ul>
      </div>
    </div>
  );
};

export default Country;

